     */
    function findAnagrams($s, $p) {
        $result = [];
        $sLen = strlen($s);
        $pLen = strlen($p);

        if ($pLen > $sLen) {
            return $result;
        }

        // Count characters in pattern p
        $pCount = array_fill(0, 26, 0);
        for ($i = 0; $i < $pLen; $i++) {
            $pCount[ord($p[$i]) - ord('a')]++;
