            // Check if current window is an anagram
            if ($this->arraysEqual($sCount, $pCount)) {
                $result[] = $i - $pLen + 1;
            }
        }

        return $result;
    }

    private function arraysEqual($arr1, $arr2) {
        for ($i = 0; $i < 26; $i++) {
            if ($arr1[$i] != $arr2[$i]) {
                return false;
            }
        }
        return true;
    }
